import React, { Component } from 'react';
import Typewriter from 'typewriter-effect';

class Type extends Component {
    render() {
        return(
            <Typewriter
                onClick={typewriter.deleteAll()}
                options={{
                    strings: ['Ask Me Anything, or Simply say Hi!'],
                    autoStart: true,
                    loop: true,
                    cursor: '_'
                }}
            />
        )
    }
};

export default Type;
